import React from 'react';
import ReactDOM from 'react-dom';

let curDate = new Date();
curDate = curDate.getHours();
let wish = "";

if(curDate >= 1 && curDate < 12){
wish="good morning";
}else if(curDate >= 12 && curDate < 19){
  wish = "good after noon";
}else{
  wish = "good night";
}
ReactDOM.render(
  <h1>hello, {wish}</h1>,
  document.getElementById("root")
);
